function setSnapClientMuted(n,t,i){$(n).toggleClass("spinner");$.ajax({type:"POST",url:"api/snap/snapclientmute",contentType:"application/json; charset=utf-8",dataType:"json",data:JSON.stringify({clientMac:t,muted:i})})}function mopidyTogglePlay(n){$.ajax({type:"POST",url:"api/mopidy/togglepause",contentType:"application/json; charset=utf-8",dataType:"json",success:t=>{n(t.state)}})}function mopidyPlayUri(n){$.ajax({type:"POST",url:"api/mopidy/playepisode",data:JSON.stringify({uri:n}),contentType:"application/json; charset=utf-8",dataType:"json"})}function reloadMe(n,t){setTimeout(function(){$(n).parent().load(t)},500)}